import React from "react";

const App = () => {
  const dispatch = useDispatch();
  return (
    <div style={{height: 1000, width: '100%', backgroundColor: 'red'}}>
      <button onClick={() => dispatch(useShowNavigationItems())}>Testing</button>
    </div>
  );
};



export default App;
